// lib
import { Routes, Route } from "react-router-dom";

// components
import Home from "../components/home/Home";
import ScreenSaver from "../components/screenSaver/ScreenSaver";
import SignIn from "../components/users/signIn/SignIn";
import SignUp from "../components/users/signUp/SignUp";
import ViewCollection from "../components/home/collection/viewCollection/ViewCollection";

export default function Routers({ HandleLogin, user }) {
  return (
    <div>
      <Routes>
        {user.username !== "" ? (
          <Route exact path="" element={<Home />} />
        ) : (
          <Route
            exact
            path=""
            element={<ScreenSaver user={user} HandleLogin={HandleLogin} />}
          />
        )}
        
        <Route
          exact
          path="users/signIn"
          element={<SignIn HandleLogin={HandleLogin} />}
        />
        <Route exact path="users/signUp" element={<SignUp />} />
        <Route exact path="collection/:cId" element={<ViewCollection />} />
      </Routes>
    </div>
  );
}
